import React from 'react';
import Link from 'next/link';
import Router from 'next/router';

const index = () => {
  return (
    <div>
      <h1>Hello Main page</h1>
      <p>
        Go to
        <Link href="/about">
          <a>About</a>
        </Link>
      </p>
      <button onClick={() => Router('')}>About</button>
    </div>
  );
};

export default index;
